import React from 'react';
import axios from 'axios';


export const login = ({ username, password }) => async dispatch => {

    try {
        const res = await axios.post("/login", {
            username: username,
            password: password
        })
        console.log(res.data);
    } catch (err) {
        console.log(err);

    }
}
